Pochi giorni fa vedendo il meteo decido di affrontare per un paio di notti una diga del centro Italia convinto che potesse essere il momento giusto...
A poche ore dalla partenza un mio amico decide di unirsi a me e una volta organizzati gli ultimo dettagli partiamo verso il Turano!
Nell' arco di un paio di ore succede qualcosa che nemmeno la piu grande sfiga del mondo riuscirebbe a garantire:vengo tamponato sul raccordo da un altra macchina (nemmeno un graffio per fortuna),passando sotto un ponte sopra il quale una macchina andava a fuoco proprio mentre passiamo noi esplode e per finire' dopo aver scaricato tutta l atrezzatura da un dirupo sotto un diluvio, il gommone si squarcia imbarcando acqua prima del trasbordo..
Cerco disperatamente un modo per non andare a casa e iniziare la pescata quando rimedio alle 11 di sera una barca a Nemi,ricarichiamo tutto e giu al piccolo vulcano..
Il resto è tante partenze e risate per esser riusciuti a passar sopra a tutto ciò con una bella pescata arrangiata all ultimo tra amici!
Anche questo è pesca e non tutto fila liscio sempre come si spera,l'importante è sapere che ci sono cose più importanti...
Ci poteva andare sicuramente molto peggio e ciò fa riflettere su quante volte viene messa a rischio la nostra salute per la pesca ,ricordiamoci sempre che invece dovrebbe essere sempre la cosa piu importante!
